import './cart.css'
import Header from '../header/Header'
import ExHeader from '../ExHeader/ExHeader'
import Products from '../Product/Product'
import CartItem from '../cartItem/CartItem'
import React, {useContext} from 'react'
import {CartContext} from '../Context'
import Footer from './../footer/Footer'


 const Cart = () => {
    const data = useContext(CartContext);
    const cartdata = useContext(CartContext);

    console.log('data', data)
   
    return (
        <>
        <Header />
        <CartItem items={data.cartItems} onRemove = {cartdata.onRemoveItem}/>
        
        <div className="cartEmpty">
            <h1>В корзине пока нет товаров</h1>    
            <p>Добавляйте понравившиеся товары и наслаждайтесь покупками️</p>  
            <button className='toCatalog'></button>  
        </div>   
           
       
        <Footer />
        </>
    );
}

export default Cart;
